import React from "react"
import Particles from "react-particles-js";

class Secondary extends React.Component() {
  render(){
        return (
            <Particles 
                params={{
                    polygon: {
                        enable: true,
                        type: 'inside',
                        move: {
                            radius: 10
                        },
                        url: 'path/to/svg.svg'
                    }
                }} />
        );
    };
}

export default Secondary;
